import React from "react";

const AutoRoles = () => {
  const autoroles = [
    { on: "Join", role: "Guest" },
    { on: "Level 3", role: "Fan" },
    { on: "Level 10", role: "Member" },
  ];
  return (
    <div className="w-100 p-4">
      <table className="table borderless w-100" style={{ color: "white" }}>
        <thead>
          <tr>
            <th scope="col">On</th>
            <th scope="col">Role</th>
          </tr>
        </thead>

        <tbody>
          {autoroles.map((x) => {
            return (
              <tr>
                {Object.keys(x).map((key) => {
                  return <td>{x[key]}</td>;
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default AutoRoles;
